class CategoryOption extends React.Component {
  render() {
      return(
    <div>
        <h2> Kategoria: <a href="/search.php?category=15" id="category"> Gry planszowe </a></h2><hr /><h4 id="title"> NOGI STONOGI Gra planszowa rodzinna dla dzieci </h4> <hr></hr>
    </div>);
  }
}


export default CategoryOption
